import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Routes, Route } from 'react-router-dom'; // ❗ only Routes and Route

import Navbar from './components/Navebar';
import HomePage from './pages/Homepage';
import CreatePostPage from './pages/CreatePostPage';
import ItineratyPage from './pages/ItineratyPage'; // your correct page name

function App() {
  return (
    <div className="App">
      <Navbar />
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/post/new" element={<CreatePostPage />} />
        <Route path="/itinerary/new" element={<ItineratyPage />} />
      </Routes>
    </div>
  );
}

export default App;
